INSERT INTO `product` (`productId`, `name`, `price`, `mainImage`, `description`, `manufacturerId`, `categoryId`, `discount`) VALUES
(33, 'Falcon', 2500000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734202141/shopbangiayuit/main.png.png', 'PHONG CÁCH THỂ THAO KẾT HỢP CHẤT LIỆU VẢI LƯỚI SIÊU NHẸ MANG ĐẾN CẢM GIÁC THOẢI MÁI MỖI NGÀY.\nLấy cảm hứng từ một phiên bản cổ điển thập niên 90, đôi giày adidas này có thiết kế mượn cảm hứng từ một kiểu dáng hầm hố, cá tính nay được cân đối lại cho phong cách hiện đại. Các chi tiết phủ ngoài bằng da lộn tổng hợp cách điệu tạo điểm nhấn cho thân giày bằng vải lưới linh hoạt, cùng đế ngoài bằng cao su bám tốt cho sải bước vững chãi.\n\n', '2', '9', 10),
(34, 'Response', 2500000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734202410/shopbangiayuit/Giay_Response_trang_GX1999_06_standard%20main.png.png', 'TRẢI NGHIỆM CẢM GIÁC ÊM ÁI VÀ ĐÀN HỒI TRÊN TỪNG SẢI BƯỚC.\nTận hưởng sự êm ái và đàn hồi trong từng buổi chạy. Đôi giày adidas này mang đến cho bạn cảm giác thoải mái và nâng đỡ cần thiết để chinh phục đường chạy hoặc đường địa hình. Thân giày bằng vải lưới và cổ giày lót đệm cho độ ôm vừa khít, thoải mái. Đệm gót giày đúc Fitcounter tạo cảm giác vừa vặn tự nhiên. Đế giữa Bounce mang lại sự êm ái và linh hoạt cho sải bước tự nhiên và đàn hồi. Làm từ một nhóm chất liệu tái chế, thân giày có chứa tối thiểu 50% thành phần tái chế. Sản phẩm này đại diện cho một trong số rất nhiều các giải pháp của chúng tôi hướng tới chấm dứt rác thải nhựa.\n\n', '2', '9', 0),
(35, 'Supernova', 2400000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734202706/shopbangiayuit/Giay_Supernova_DJen_GW9107_06_standard%20main.png.png', 'CHẠY BỘ ĐẦY THOẢI MÁI VỚI GIÀY SUPERNOVA+.\nNăng lượng kết hợp sự thoải mái trong đôi giày adidas Supernova+. Bất kể cự ly và tốc độ tập luyện, giày Supernova+ sẽ giúp bạn vươn tới mục tiêu. Giống như giày Supernova, đôi giày adidas này kết hợp đệm Boost và Bounce. Dấu cộng trong tên gọi của phiên bản này thể hiện lượng Boost tăng cường ở mũi giày so với giày Supernova, giúp tăng cường hoàn trả năng lượng và sự thoải mái trên từng sải bước. Trải nghiệm nguồn năng lượng dâng tràn từ buổi chạy đầy thoải mái.\n\n', '2', '9', 10),
(36, 'Ultraboost Light', 4900000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734202848/shopbangiayuit/Giay_Ultraboost_Light_trang_ID3285_HM7%20main.png.png', 'ĐÔI GIÀY CHẠY BỘ NÀY CÓ SỬ DỤNG CHẤT LIỆU TÁI CHẾ.\nMỗi ngày đều đặc biệt. Lớp đệm BOOST siêu nhẹ mang đến trải nghiệm tràn đầy năng lượng trong từng sải bước. Thân giày adidas PRIMEKNIT+FORGED chạy theo chuyển động của bạn và thích ứng theo hình dáng bàn chân trong lúc chạy bộ. Phong cách độc đáo xóa nhòa xu hướng, dễ dàng kết hợp với quần jogger cho buổi chạy ra quán cafe hay lên đồ khám phá thành phố. Bất kể lịch trình hôm nay thế nào, đôi giày Ultraboost Light sẽ khiến tương lai của bạn trở nên dễ dàng. Sản phẩm này có chứa tối thiểu 20% chất liệu tái chế. Bằng cách tái sử dụng các chất liệu đã được tạo ra, chúng tôi góp phần giảm thiểu lãng phí và hạn chế phụ thuộc vào các nguồn tài nguyên hữu hạn, cũng như giảm phát thải từ các sản phẩm mà chúng tôi sản xuất.\n\n', '2', '9', 0),
(37, 'Adizero x Parley', 3600000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734202972/shopbangiayuit/Giay_Adizero_x_Parley_Hong_HR2040_06_standard%20main.png.png', 'ĐÔI GIÀY CHẠY BỘ SIÊU NHẸ CÓ NGUỒN GỐC TỰ NHIÊN.\nVào ngày thi đấu, bạn chỉ có một cơ hội để giật tung dải băng ở vạch đích. Hãy chuẩn bị sẵn sàng với đôi giày chạy bộ adidas này. Giày có lớp đệm Lightstrike siêu nhẹ cho tốc độ ở tầm cao mới. Đế giữa bằng chất liệu EVA sinh học cũng có tác động nhẹ nhàng hơn tới tài nguyên môi trường, với một phần hàm lượng có nguồn gốc từ mía. Điều đó cũng ngọt ngào gần như cảm giác là người đầu tiên về đích. Mẫu giày chạy bộ này làm từ các chất liệu tự nhiên và có thể tái tạo, là một phần trong hành trình của chúng tôi hướng tới chấm dứt sử dụng tài nguyên hữu hạn và góp phần loại bỏ rác thải nhựa.\n\n', '2', '10', 0),
(38, 'Ultraboost Light Women', 4800000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734203143/shopbangiayuit/Giay_Chay_Bo_Ultraboost_Light_Mau_xanh_da_troi_IF1486_HM1%20main.png.png', 'ĐÔI GIÀY CHẠY BỘ ĐÀN HỒI CÓ SỬ DỤNG CHẤT LIỆU TÁI CHẾ.\nDi chuyển thật nhẹ nhàng và thoải mái. Đôi giày chạy bộ đàn hồi dành cho nữ này được trang bị lớp đệm BOOST nhẹ nhất từ trước đến nay của chúng tôi. Với mỗi sải chân, đế giữa siêu đàn hồi hoàn trả năng lượng giúp bạn vững bước trên suốt đường chạy. Thân giày và lớp lót bằng vải dệt ôm trọn bàn chân bạn cho cảm giác thoáng khí và nâng đỡ, cùng đế ngoài bằng cao su bám tốt suốt những buổi chạy khí thế nhất. Phù hợp để chạy bộ hàng ngày nhưng cũng không kém phần thời thượng để mang hàng ngày, hãy trải nghiệm sự thoải mái và tốc độ và khai phá nguồn năng lượng của riêng bạn. Sản phẩm này có chứa tối thiểu 20% chất liệu tái chế. Bằng cách tái sử dụng các chất liệu đã được tạo ra, chúng tôi góp phần giảm lãng phí và giảm phụ thuộc vào các nguồn tài nguyên hữu hạn, cũng như giảm phát thải từ các sản phẩm mà chúng tôi sản xuất.\n\n', '2', '10', 0),
(39, 'Solarglide 6', 4000000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734203269/shopbangiayuit/Giay_SOLARGLIDE_6_Mau_tim_HP7655_06_standard%20main.png.png', 'ĐÔI GIÀY CHẠY BỘ THƯỜNG NGÀY CÓ SỬ DỤNG CHẤT LIỆU TÁI CHẾ.\r\nCó những đôi giày có thể dùng để chạy bộ. Nhưng giày chạy bộ chuyên dụng lại là một đẳng cấp khác. SOLARGLIDE 6 là đôi giày bạn mang hàng ngày để nhắm tới mục tiêu, chẳng hạn như tăng cự ly hoặc chinh phục kỷ lục cá nhân. Đôi giày này có trang bị các công nghệ cần thiết giúp bạn tiến xa hơn, nhanh hơn, trong đó có lớp đệm BOOST đàn hồi. Hệ thống adidas LEP 2.0 định hướng từng sải chân để tạo đà tiến về phía trước, cùng đế ngoài Continental™ Rubber cho độ bám vượt trội trên bề mặt ẩm ướt cũng như khô ráo.\r\n\r\n', '2', '10', 25),
(40, 'Biti’s Hunter HSM002900', 1305000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734203414/shopbangiayuit/magiay%20main.png.png', 'Giới thiệu:\nMặc dù không quá cầu kỳ trong thời trang như phụ nữ nhưng phái mạnh cũng có một số phụ kiện thiết yếu trong tủ đồ của mình. Một item không thể thiếu của các chàng đó chính là đôi giày thể thao. Mẫu giày thể thao nam Biti’s Hunter HSM002900 có kiểu dáng rất hiện đại, trẻ trung, phù hợp cho đi chơi, dã ngoại và các hoạt động thể dục cho những tín đồ thời trang năng động. Mẫu giày cá tính này sẽ giúp các chàng trai khẳng định rõ nét phong cách cá nhân của chính mình.\n\nThông tin chi tiết: \n- Đế giày:\n+ Đế giày của HSM002900 là đế LITEFLEX 3.0 form dáng chunky gọn chân đàn hồi tốt\n+ Lót đế O Foam kháng khuẩn với chất liệu Ortholite, êm ái và hút ẩm hạn chế mùi tuyệt đối\n+ Đế giày rất nhẹ, êm ái, có nhiều rãnh chống trơn trượt tạo cho bạn cảm giác thoải mái, tự tin vận động\n+ Xung quanh giày được xử lý tạo độ cứng, tăng thêm lớp phủ giúp bảo vệ chân khỏi va chạm\n\n- Thân giày:\n+ Thân trên giày sở hữu những đường nét thiết kế đặc sắc, trẻ trung mạnh mẽ cùng màu sắc ấn tượng\n+ Giày được làm từ chất liệu vải dệt Knit thông hơi thoáng khí rất thoải mái\n+ Giày mềm mại, xung quanh có các lỗ thông khí, kháng khuẩn, tạo cảm giác dễ chịu nhất cho bạn dù mang cả ngày dài\n+ Sản phẩm với thiết kế cổ bo chun co giãn giúp bạn dễ dàng hơn khi mang\n+ Đôi giày sẽ giúp phái mạnh che đi ánh sáng trực tiếp từ mặt trời, giúp tránh bàn chân bị cháy nắng đỏ rát và tạo sự thoải mái cho các hoạt động ngoài trời', '3', '9', 15),
(41, 'Biti\'s Hunter X Wavy Collection HSM001400', 1005000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734203529/shopbangiayuit/2%20x%C3%A1m%20m%C3%A1%20gi%C3%A0y%20main.png.png', 'Giới thiệu:\nGiày Thể Thao Nam Biti\'s Hunter X Wavy Collection HSM là mẫu giày thể thao sở hữu vẻ đẹp hoàn hảo và bền chắc với bộ đế được sản xuất theo công nghệ độc quyền từ BITI’S Hunter. Từng đường kim mũi chỉ đều được trau chuốt tỉ mỉ đem lại sự bền chắc và tinh tế cho sản phẩm. Biti\'s Hunter X Wavy Collection HSM là lựa chọn đáng được bạn cân nhắc cho các môn thể thao chuyên cho chạy, đi bộ hoặc những hoạt động ngoài trời khác.\n\nThông tin chi tiết:\n- Đế giày:\n+ Dáng hình mô phỏng lốp xe mạnh mẽ, làm nổi bật lên vẻ đẹp cá tính dành cho người dùng.\n+ Chất liệu IP cao su nhẹ, hỗ trợ chiều cao lên đến > 5cm. Bên cạnh đó, người dùng sẽ được trải nghiệm bước đi nhẹ như bay với độ đàn hồi > 40%, dễ dàng di chuyển mọi địa hình và thời tiết.\n+ Lưới kháng khuẩn từ chất liệu Ortholite thun cá sấu, giúp ngăn mùi hiệu quả.\n+ Được ép khuôn 3D với công nghệ massage 6 điểm, vừa vặn, ôm trọn và nâng niu bàn chân không thua kém bất kỳ một thương hiệu nổi tiếng nào.\n+ Công nghệ đế hai lớp – tiếp đất êm, chống trượt hiệu quả, độ đàn hồi vượt trội >40%, giúp người dùng dễ dàng di chuyển.\n\n- Thân giày:\n+ Chất liệu: Sử dụng vải Liteknit với độ co giãn tốt, khả năng thoáng khí cao. Người dùng sẽ cảm giác thoải mái, dễ chịu khi mang.\n+ Quai Knits /Si Nubucks cấu trúc lớp co giãn, bề mặt mịn như nhung, khả năng chống mài mòn cao.\n+ Thiết kế đường Layer uốn lượn, tạo điểm nhấn sản phẩm.\n+ Phần hậu và má trong với chất liệu Mesh tăng thêm trải nghiệm từng bước chân.\n', '3', '9', 0),
(42, 'Biti\'s Hunter Core HSM000500', 771000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734203617/shopbangiayuit/magiay%20main.png.png', 'Giới thiệu:\nGiày Thể Thao Nam Biti\'s Hunter Core HSM là dòng sản phẩm sở hữu thiết kế khỏe khoắn với bộ đế êm ái có khả năng đàn hồi cao. Giày hỗ trợ vận động nhẹ nhàng và cũng chính là đôi giày thời trang đang được yêu thích, sản phẩm được Biti’s chú trọng đến chất lượng và tập trung cao vào việc cải thiện cảm nhận người dùng. Thiết kế thời trang, phù hợp với xu hướng hiện đại Giày Thể Thao Nam Biti\'s Hunter Core HSM là sự lựa chọn hoàn hảo cho phái mạnh sử dụng cho các chuyến leo núi, trekking hay hoạt động ngoài trời khác.\n\nThông tin chi tiết:\n- Đế giày:\n+ Sản phẩm được sử dụng công nghệ đế Phylon cao su nhẹ độc quyền của Biti’s Hunter thế nên tạo được sự “nhẹ như bay”, ổn định cho đôi giày.\n+ Phần đế tiếp xúc sử dụng cao su kết hợp với các rãnh tạo độ ma sát, có độ bám dính cao, chống trơn trượt, khả năng chịu lực tốt, chống mài mòn và đem lại sự an toàn khi hoạt động nhất là trong những ngày trời mưa.\n+ Lót đế trong giúp ngăn mùi hiệu quả.\n+ Được ép khuôn 3D ôm trọn bàn chân, mang tới cảm giác êm ái, thoải mái và khả năng hỗ trợ trợ lực với bàn chân, tránh trượt, tụt gót, xê dịch và nâng niu bàn chân một cách tuyệt đối.\n+ Biti\'s Hunter Core HSM được thiết kế có phần đế giữa cao khoảng 3cm, thấp dần về phía mũi, mang nhiều đường cắt xẻ đem lại vẻ khỏe khoắn cho đế giày.\n+ Đế được làm từ chất liệu nhẹ, êm, mềm dẻo, chống nước, ép khuôn 3D bằng dây chuyền hiện đại tạo đàn hồi tốt, độ bền cao, hấp thu chất động, giảm ma sát, hỗ trợ lực và tạo độ êm ái đàn hồi khi di chuyển.\n\n- Thân giày:\n+ Chất liệu: Mũ quai dệt knits cấu trúc lớp co giãn nhằm tiết giảm chi tiết trên giày, hơn nữa khi sử dụng sẽ không bị nhăn và tạo nếp, không bí bách, thông thoáng khí, nhẹ, mát, dễ bảo quản và vệ sinh.\n+ Thiết kế: Sản phẩm có thiết kế trẻ trung, mạnh mẽ, đường Layer uốn lượn, tạo điểm nhấn cho giày.\n', '3', '9', 0),
(43, 'Biti\'s Hunter Running DSMH10000', 1010000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734203717/shopbangiayuit/4%20v%C3%A0ng%20m%C3%A1%20gi%C3%A0y%20main.png.png', 'Giới thiệu:\nGiày Chạy Bộ Nam Biti\'s Hunter Running DSMH10000 là mẫu giày chạy với bộ đế thế hệ vượt trội và công nghệ độc quyền từ BITI’S Hunter không những đem đến sự thoải mái khi vận động mà còn mang đến cho người sử dụng phong cách thể thao năng động và sự ấn tượng cho mọi người. Biti\'s Hunter Running DSMH10000 là sự lựa chọn hoàn hảo cho các môn thể thao hay các hoạt động ngoài trời khác.\n\nThông tin chi tiết:\n- Đế giày:\n+ Đế ngoài được tạo bằng lớp cao su chống trơn trượt  có độ bám cao, giúp cho người dùng tăng khả năng bám chặt trên mọi địa hình.\n+ Đế trong được lót 2 lớp kết hợp Ortholite và Eva, rất vừa vặn với cấu trúc lòng bàn chân đặc trưng của người Việt, cùng độ êm được tính toán kỹ lưỡng nhất.\n+ Đế giữa sử dụng công nghệ đế hai lớp – tiếp đất êm, phản hồi lực mạnh mẽ với độ đàn hồi vượt trội >50%, cho đường chạy nhẹ như bay.\n\n- Thân giày:\n+ Chất liệu: Sử dụng vải dệt Jacquard mềm mại, ôm trọn theo sự chuyển động của bàn chân và cấu tạo thiết kế thoáng khí tối đa đem đến một sự thông thoáng.\n+ Lưỡi gà: Được may dính liền với thân giày, chất liệu co giãn tốt nên bạn có thể dễ dàng mang vào, tháo ra mà không cần phải tháo dây.\n+ Thiết kế: Biti\'s Hunter Running  DSMH10000 có thiết kế hiện đại, phong cách trẻ trung.\n', '3', '10', 0),
(44, 'Biti\'s Hunter Running HSM003800', 1050000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734203793/shopbangiayuit/5%20xanh%20mi%20n%C6%A1%20m%C3%A1%20gi%C3%A0y%20main.png.png', 'Giới thiệu:\nRèn luyện thể dục thể thao là một hoạt động tốt mà bất cứ ai cũng nên thực hiện mỗi ngày. Để làm được điều này, ngoài lòng quyết tâm thì một đôi giày tốt chắc chắn là điều không thể thiếu để bảo vệ đôi chân của bạn trong suốt hành trình. Nếu bạn vẫn chưa biết nên mua đôi giày nào giá ổn, chất lượng tốt, thì mẫu Giày Chạy Bộ Nam Biti\'s Hunter Running HSM003800 là sự lựa chọn hoàn hảo.\n\nThông tin chi tiết:\n- Đế giày:\n+ Đế giày Biti\'s Hunter Running HSM003800 cho nam được làm từ chất liệu IP cao cấp. Đây cũng là chất liệu được Biti’s ưu tiên sử dụng trong các sản phẩm của mình vì ngoài mang lại vẻ đẹp thẩm mỹ toàn diện, chất liệu IP còn nhẹ như bay, cho bạn cảm giác mang như không mang, cực kỳ thoải mái.\n+ Chưa kể, chất liệu này còn có khả năng đàn hồi cao, hạn chế cong vênh, gấp khúc, biến dạng sau một thời gian sử dụng.\n+ Vì là giày chuyên dụng để chạy bộ nên đáy giày được thiết kế các vân rãnh sâu, giúp ma sát mặt đường, hạn chế trơn trượt gây té ngã khi di chuyển nhanh.\n\n-Thân giày:\n+ Thân giày được làm từ chất liệu vải cao cấp, có thiết kế hệ thống lưới thoát khí. Nhờ đó, người dùng có thể thoải mái dùng giày để chạy bộ, rèn luyện thể thao mà không lo bí bách mồ hôi gây mùi khó chịu.\n+ Quai giày được làm từ da tổng hợp, ngoài đảm bảo bền bỉ theo thời gian còn hạn chế bụi bẩn bám dính.\n+ Phần cổ giày ôm sát cổ chân, giúp đôi chân thêm thon gọn và hạn chế bị lật cổ chân khi vận động mạnh.\n', '3', '10', 0),
(45, 'Biti\'s Hunter X HSW002300', 1170000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734203897/shopbangiayuit/6%20tr%E1%BA%AFng%20m%C3%A1%20gi%C3%A0y%20main.png.png', 'Giới thiệu:\nGiày Thể Thao Nữ Biti\'s Hunter X HSW002300 mang một dáng vẻ tinh tế, sang trọng. Với chất lượng hoàn hảo và dễ dàng phối đồ trong nhiều hoàn cảnh. Chắc chắn thiết kế sẽ làm hài lòng rất nhiều bạn nữ. Nếu bạn đang phân vân liệu có nên rinh Giày Thể Thao Nữ Biti\'s Hunter X HSW002300 về nhà thì đừng ngần ngại liên hệ ngay với nhà Biti’s để được tư vấn thêm sở hữu thiết kế này trong tủ đồ của mình nhé! Thiết kế chắc chắn sẽ làm hài lòng kể cả những khách hàng khó tính nhất!\n\nThông tin chi tiết:\n- Đế giày:\n+ Đế ngoài sử dụng Phylon nhẹ nhàng. Mặt đế thiết kế với các rãnh tăng độ ma sát giúp bạn vững chắc trên từng bước chân, ngoài ra đế rất bền bỉ, độ shore phù hợp, êm ái và nẩy tốt giúp bảo vệ và nâng đỡ đôi bàn chân mỗi khi sử dụng. Đế giày kéo dài bọc tới mũi bàn chân để bảo vệ và tránh va đập.\n+ Đế giữa (Midsole) chất liệu IP cao cấp, nhẹ, được ép nóng và định hình lạnh trong khuôn 3D để sở hữu độ đàn hồi tốt, độ bền cao, êm ái trong chuyển động. Có các rãnh thiết kế bao quanh giúp hài hòa cho tổng thể cả đôi giày.\n+ Thành đế cao từ dưới xuống mũi chân giúp người dùng nâng chiều cao một cách dễ dàng, tinh tế, ôm gọn bàn chân và liên kết với thân giày.\n+ Đế trong được chất liệu Ortholite, thun cá sấu ngăn mùi, ép khuôn 3D và công nghệ 6 điểm massage lòng bàn chân khiến cho người dùng thoải mái khi di chuyển. Đế được làm từ chất liệu mềm dẻo, chống nước, thông thoáng và được tính toán kỹ lưỡng trên bàn chân người dùng.\n\n- Thân giày:\n+ Với thiết kế đầy đủ dây giày, khách hàng có thể điều chỉnh tự do dây sao cho phù hợp với độ lớn thân bàn chân của mình.\n+ Thiết kế quai da tổng hợp, mềm mại, thông thoáng mà không gây hầm bí.\n+ Mang vẻ đẹp tinh tế, hiện đại, dễ dàng phối đồ trong nhiều hoàn cảnh, đặc biệt là có thể dùng đi dạo, chạy bộ nhẹ nhàng.\n+ Đường chỉ may chắc chắn, bền bỉ.\n+ Phần thân có các nét họa tiết đơn giản kết hợp với màu bạc cùng logo của nhà Biti’s trang trí trên giày.\n', '3', '9', 0),
(46, 'Biti\'s Hunter X HSW003100', 1000000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734203987/shopbangiayuit/7%20xanh%20d%C6%B0%C6%A1ng%20m%C3%A1%20gi%C3%A0y%20main.png.png', 'Giới thiệu:\nGiày thể thao nữ Biti\'s Hunter X HSW003100 mang đến trải nghiệm hiệu suất tuyệt đỉnh, như thể bạn đang ở trong trạng thái không trọng lượng với thiết kế cực kỳ nhẹ. Sản phẩm được thiết kế phân vùng hợp lý với từng khu vực khác nhau, chắc chắn và bền bỉ, phù hợp hơn với bề mặt chân. Khu vực phía trước mềm mại và thoải mái, khu vực giữa eo được nâng đỡ chặt chẽ và khu vực gót chân được bao bọc ổn định, mang lại cảm giác đeo thoải mái, vừa vặn cho người sử dụng. Biti\'s Hunter X HSW003100 giúp bạn vươn lên một tầm cao mới, nó mang đến cảm giác hỗ trợ tối đa trong mỗi bước đi. Đôi giày xứng đáng trở thành người bạn đáng tin cậy và sẵn sàng đồng hành cùng bạn mỗi ngày.\n\nThông tin chi tiết:\n- Đế giày:\n+ Đế giày IP giúp tăng cường khả năng đàn hồi và hạn chế việc hư hỏng form dáng\n+ Công nghệ đế giày mang lại cảm giác không trọng lượng giúp tiết kiệm sức lực và giảm thiểu tác động\n+ Lớp đệm giày thể thao siêu nhẹ, thoáng khí và mềm tạo cảm giác nhạy bén mang lại trải nghiệm tuyệt vời khi di chuyển\n+ Đế ngoài chống trượt với các rảnh cắt xẻ, uốn cong di chuyển tự nhiên theo bàn chân của bạn, giúp tăng độ bền và ổn định giày\n\n-Thân giày:\n+ HSW003100 với vẻ ngoài thể thao năng động, phần trên bằng Si mềm mại, các đường may tỉ mỉ và tinh tế\n+ Giày mang lại âm thanh tràn đầy năng lượng cho sải chân của bạn, hoàn hảo cho quãng đường dài. Thân giày với khả năng co giãn và thoáng khí\n+ Cảm nhận sự ổn định với thiết kế thắt dây, giữ cho bàn chân được cố định và vững chãi trong từng bước chân', '3', '9', 0),
(47, 'Hunter Core - Checkmate Collection HSW000100', 834000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204068/shopbangiayuit/8%20tr%E1%BA%AFng%20m%C3%A1%20gi%C3%A0y%20main.png.png', 'Giới thiệu:\nGiày Thể Thao Nữ Biti\'s Hunter Core - Checkmate Collection là dòng giày được Biti’s chú trọng đến chất lượng và tập trung cao vào việc cải thiện cảm nhận người dùng. Áp dụng công nghệ cao giày giúp hỗ trợ vận động nhẹ nhàng và cũng là đôi giày thời trang đang được yêu thích.\n\nThông tin chi tiết:\n- Đế giày:\n+ Sản phẩm được sử dụng công nghệ đế Phylon cao su nhẹ độc quyền của Biti’s Hunter thế nên tạo được sự “nhẹ như bay”, ổn định cho đôi giày. \n+ Phần đế tiếp xúc sử dụng cao su kết hợp với các rãnh tạo độ ma sát, có độ bám dính cao, chống trơn trượt, khả năng chịu lực tốt, chống mài mòn và đem lại sự an toàn khi hoạt động nhất là trong những ngày trời mưa.\n+ Lót đế trong giúp ngăn mùi hiệu quả.\n+ Được ép khuôn 3D ôm trọn bàn chân, mang tới cảm giác êm ái, thoải mái và khả năng hỗ trợ trợ lực với bàn chân, tránh trượt, tụt gót, xê dịch và nâng niu bàn chân một cách tuyệt đối.\n+ Biti\'s Hunter Core - Checkmate Collection được thiết kế có phần đế giữa cao khoảng 3cm, thấp dần về phía mũi, mang nhiều đường cắt xẻ đem lại vẻ khỏe khoắn cho đế giày.\n+ Đế được làm từ chất liệu nhẹ, êm, mềm dẻo, chống nước, ép khuôn 3D bằng dây chuyền hiện đại tạo đàn hồi tốt, độ bền cao, hấp thu chất động, giảm ma sát, hỗ trợ lực và tạo độ êm ái đàn hồi khi di chuyển.\n\n-Thân giày:\n+ Chất liệu: Thân trên giày/mũ quai tạo miếng si đắp với đường nét uốn lượn trẻ trung hơn.\n+ Thiết kế: Sản phẩm có thiết kế trẻ trung, thiết kế cổ vớ thuận tiện cho thao tác mang.', '3', '9', 0),
(48, 'Biti’s Hunter Jogging HSW003000', 730000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204142/shopbangiayuit/9%20xanh%20ng%E1%BB%8Dc%20m%C3%A1%20gi%C3%A0y%20main.png.png', 'Giới thiệu:\nGiày chạy bộ nữ Biti’s Hunter Jogging HSW003000 siêu nhẹ là sự cân bằng hoàn hảo giữa đơn giản và hiện đại. Đây là đôi giày đáng tin cậy cho các hoạt động thể thao, đặc biệt là các hoạt động chạy bộ và tập thể dục. Với tính năng tốt, trọng lượng nhẹ, độ bền và hỗ trợ chân. Sản phẩm sẽ giúp bạn đạt được mục tiêu tập của mình một cách hiệu quả và an toàn. Giày chạy bộ nữ Biti’s Hunter Jogging HSW003000 thiết kế dành cho người chạy bộ thường ngày. Sản phẩm sử dụng vật liệu đế giảm sốc tốt để mang lại trải nghiệm đàn hồi tốt, phối cùng bề mặt giày mềm mại giúp cho bàn chân được bao bọc và hỗ trợ mạnh mẽ trong quá trình chạy bộ, giúp người chạy cảm thấy thoải mái trong từng bước chạy.\n\nThông tin chi tiết:\n- Đế giày:\n+ Đế giày Biti’s Hunter Jogging HSW003000 là cao su non đàn hồi phù hợp với mọi điều kiện thời tiết, chống trơn trượt khi di chuyển.\n+ Lót giày ứng dụng công nghệ Lightfoam giúp độ co giãn được phát huy rõ rệt, tăng cường thêm tính năng sản phẩm như chống mỏi, thấm hút mồ hôi, nâng cao hiệu suất tốt cho bạn với các mục đích sử dụng khác nhau.\n+ Phần đế ngoài bền bỉ, chống mài mòn cao, chịu ma sát trên mọi địa hình địa thế, tỉ lệ chống nước cao đến 25%.\n\n- Thân giày:\n+ Bề mặt giày chạy bộ với thiết kế sáng tạo đi trước thời đại trên chất liệu thun lưới phù hợp với trạng thái tự nhiên của đôi chân, tạo nên sự ôm sát nhưng vẫn thoải mái trong quá trình di chuyển, luyện tập\n+ HSW003000 là mẫu giày chạy bộ thời trang nổi bật với các đường họa tiết lượn sóng dọc thân và đế giày, mang đến cảm giác mềm mại, uyển chuyển\n+ Cổ giày sang trọng, co giãn tốt, tiện lợi và dễ dàng khi mang', '3', '10', 0),
(49, 'Biti’s Hunter Jogging DSWH10100', 600000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204227/shopbangiayuit/10%20xanh%20d%C6%B0%C6%A1ng%20l%E1%BB%A3t%20m%C3%A1%20gi%C3%A0y%20main.png.png', 'Giới thiệu:\nGiày đi bộ nữ Hunter Jogging DSWH10100 là dòng sản phẩm sở hữu thiết kế khỏe khoắn, bên chắc cùng khả năng đàn hồi cao. Giày không chỉ hỗ trợ các bạn nữ vận động nhẹ nhàng mà còn đảm bảo tính thời trang, thẩm mỹ cho người dùng. Giày đi bộ nữ Hunter Jogging DSWH10100 là lựa chọn tốt dành cho những bạn nữ muốn trang bị một đôi giày thể thao cá tính, chất lượng mang đến trải nghiệm thoải mái, êm ái nhất mọi lúc mọi nơi.\n\nThông tin chi tiết:\n- Đế giày:\n+ Sử dụng đế giày IP (Nhật Bản) cao cấp, làm từ cao su non nên siêu bền, nhẹ và có khả năng chống nước cao.\n+ Đế giày được thiết kế các rãnh chống trượt, hỗ trợ người dùng di chuyển an toàn trên mặt đường ẩm ướt, trơn.\n+ Đế có khả năng chịu lực tốt, giúp người dùng thoải mái khi di chuyển.\n+ Lót đế trong giúp ngăn mùi, mồ hôi hiệu quả.\n+ Đế được ép khuôn 3D bằng dây chuyền hiện đại, đàn hồi tốt, ôm trọn bàn chân, mang đến cảm giác êm ái, không xê dịch và nâng niu bàn chân một cách tuyệt đối.\n+ Biti’s Hunter Hunter Jogging DSWH10100 có đế giữa cao 5cm thấp về phía trước, kết hợp hợp cùng đường cắt xẻ mang lại vẻ khỏe khoắn cho đế giày.\n+ Phần đế thiết kế ôm trọn bàn chân tạo cảm giác đi nhẹ nhàng, thoải mái cho người dùng. \n\n- Thân giày:\n+ Phần quai có ứng dụng công nghệ dệt lưới không giãn, nâng cao độ bền cho quai.\n+ Trên thân giày được dệt lưới, có lỗ thoáng khí nhỏ phủ đều khắp bề mặt. Nhờ đó, người mang giày sẽ có cảm giác thông thoáng khí và thoải mái nhất khi sử dụng.\n+ Sản phẩm có thiết kế trẻ trung, mạnh mẽ, đường Layer uốn lượn tạo điểm nhấn cho đôi giày.\n', '3', '11', 0),
(50, 'Chuck Taylor All Star Malden Street', 1080000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204325/shopbangiayuit/be%20m%C3%A1%20main.png.png', 'Những đôi giày mid-top mang tính biểu tượng này được nâng cấp với một diện mạo mới theo mùa. Đường may đa dạng gợi nhớ đến phong cách thủ công, trong khi đệm mềm mại mang lại sự thoải mái cho bước chân mùa hè của bạn.\n\nChi tiết:\n- Vải canvas cổ điển mang lại vẻ ngoài và cảm giác vượt thời gian của Chucks\n- Đệm OrthoLite giúp cung cấp sự thoải mái tối ưu\n- Lỗ xỏ dây bền, dệt chặt chẽ\n- Miếng vá Chuck Taylor mang tính biểu tượng ở mắt cá chân', '4', '9', 0),
(51, 'Chuck 70 Plus', 2500000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204398/shopbangiayuit/%C4%91en-m%C3%A1%20main.png.png', 'Một bản cập nhật bất ngờ trên một mẫu kinh điển mọi thời đại, Chuck 70 Plus kết hợp các đặc điểm mang tính biểu tượng với phong cách hướng tới tương lai. Sự kết hợp của vải canvas có trọng lượng khác nhau cùng với các đường nét táo bạo, không đối xứng tạo nên một diện mạo nổi bật. Các chi tiết cao su và miếng vá mắt cá chân được cắt ghép giữ mọi ánh nhìn tập trung vào bạn, trong khi đệm cao cấp giúp bạn cảm thấy nhẹ nhàng trên đôi chân.\n\nChi tiết:\n- Giày cao cổ với phần trên bằng vải canvas\n- Đệm OrthoLite mang lại sự thoải mái suốt cả ngày\n- Thiết kế không đối xứng, hợp nhất và lưỡi giày kéo dài tạo nên phong cách nổi bật\n- Đế cao su chia cắt làm nổi bật các yếu tố thiết kế đặc trưng của Chuck Taylor\n- Miếng vá mắt cá chân Chuck Taylor được thêm vào sản phẩm', '4', '9', 0),
(52, 'Star Player 76', 1600000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204458/shopbangiayuit/tr%E1%BA%AFng%20m%C3%A1%20main.png.png', 'Làm mới phong cách của bạn với những đôi giày thể thao cổ thấp này. Chi tiết vải canvas và da bền bỉ mang lại phong cách cổ điển cho bước đi mùa hè của bạn, trong khi màu sắc táo bạo theo mùa thổi luồng sinh khí mới vào bất kỳ tủ đồ nào.\n\nChi tiết:\n- Vải canvas cổ điển mang lại vẻ ngoài và cảm giác vượt thời gian của Star Player\n- Đệm OrthoLite giúp cung cấp sự thoải mái tối ưu\n- Đế ngoài có hoa văn gạch đúc và mũi giày có kết cấu kim cương cổ điển\n- Biểu tượng Star Chevron bằng da mang tính biểu tượng\n', '4', '9', 0),
(53, 'Converse x OLD MONEY Weapon', 2170000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204518/shopbangiayuit/tr%E1%BA%AFng%20m%C3%A1%20main.png.png', 'Thể hiện phong cách cá nhân của bạn với một đôi giày từ Converse. Dòng giày và giày thể thao của chúng tôi được thiết kế để mang lại sự thoải mái tối ưu và phong cách đường phố vượt thời gian. Với dáng vẻ phong cách và mang tính biểu tượng, Converse cung cấp nhiều loại giày phù hợp với cá tính của bạn.\n', '4', '10', 0),
(54, 'Converse x Comme des Garçons PLAY Chuck 70 Multi Heart', 3100000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204589/shopbangiayuit/%C4%91en%20m%C3%A1%20main.png.png', 'Thể hiện tình yêu của bạn qua đôi giày với Converse x Comme des Garçons PLAY Chuck 70. Phong cách sẵn sàng cho đường phố này có các chi tiết Chuck cao cấp mà bạn biết và yêu thích, kết hợp với đồ họa trái tim và mắt vui nhộn.  \n\nChi tiết:\n- Phần trên bằng vải canvas nhẹ và bền\n- Mũi giày cao su tông màu và gót đen tạo phong cách nổi bật\n- Thiết kế buộc dây cho sự vừa vặn\n- Đế cao su lưu hóa tăng độ bám\n- Logo trái tim và mắt đặc trưng thêm phần vui nhộn\n', '4', '9', 0),
(55, 'Chuck 70 Plus XHI', 3000000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204644/shopbangiayuit/tr%E1%BA%AFng%20m%C3%A1%20main.png.png', 'Một bản cập nhật bất ngờ trên một thiết kế kinh điển, Chuck 70 Plus XHI làm thay đổi DNA mang tính biểu tượng của Chuck Taylor. Các đường nét táo bạo, chi tiết cắt và phần cổ cao thêm giữ mọi ánh nhìn đổ dồn vào bạn. Thêm phong cách punk cho những bộ trang phục yêu thích của bạn—từ sân khấu đến công viên, những đôi Chucks này sẵn sàng để tỏa sáng.\n\nChi tiết: \n- Phần trên bằng vải canvas: Giữ nguyên vẻ ngoài cổ điển của Chucks.\n- Đệm OrthoLite: Giúp cung cấp sự thoải mái tối ưu.\n- Khóa kéo: Dễ dàng mang vào và tháo ra.\n- Lưỡi giày kéo dài và đế cao su chia đôi: Làm biến dạng các chi tiết đặc trưng của Chuck Taylor để tạo nên vẻ ngoài độc đáo.\n- Miếng vá mắt cá chân Chuck Taylor mang tính biểu tượng và biển số All Star cổ điển: Thêm một chút phong cách cổ điển.\n', '4', '9', 0),
(56, 'Chuck Taylor All Star Lift', 1800000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204703/shopbangiayuit/%C4%91en%20m%C3%A1%20main.png.png', 'Những đôi Chucks mang tính biểu tượng mà bạn yêu thích, được nâng lên gấp đôi. Chọn đôi này nếu bạn muốn buff chiều cao.\n\nChi tiết:\n- Phần trên bằng vải canvas Nhẹ và bền.\n- Silhouette vượt thời gian chắc chắn bạn sẽ thích.\n- Đế cao su xếp chồng đôi tăng thêm chiều cao.\n- Lỗ thoáng khí bên trong giúp giữ cho đôi chân của bạn mát mẻ.\n- Biển số được tái thiết kế thêm phần độc đáo.\n', '4', '10', 0),
(57, 'Weapon', 2500000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204755/shopbangiayuit/be%20m%C3%A1%20main.png.png', 'Muốn thêm chút phong cách thập niên 90? Hãy mang đôi Weapon này, tôn vinh những đôi giày bóng rổ và trượt ván từ thời kỳ đó. Phần trên bằng da bền bỉ với màu sắc retro mang lại vẻ ngoài yêu thích trước năm 2000.\n\nChi tiết:\n- Phần trên bằng da và nubuck với vẻ ngoài cổ điển của Weapon.\n- Đệm CX giúp cung cấp sự thoải mái ở mức độ cao.\n- Dây giày bằng cotton phẳng đảm bảo độ bền.\n- Nhãn lưỡi giày All Star dệt mang tính biểu tượng.\n', '4', '10', 0),
(58, 'Run Star Legacy', 2900000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204809/shopbangiayuit/tr%E1%BA%AFng%20m%C3%A1%20main.png.png', 'Nâng tầm phong cách của bạn chưa bao giờ dễ dàng hơn thế. Lấy cảm hứng từ sự tinh tế giản dị của áo blazer, những đôi giày cao cổ này kết hợp phong cách không thể nhầm lẫn của All Star với những cập nhật tinh tế. Các chất liệu sang trọng, đa dạng và màu sắc tông nhẹ nhàng kết hợp với các chi tiết khâu tinh tế để tạo nên một vẻ ngoài cao cấp, dễ dàng.\n\nChi tiết:\n- Phần trên bằng vải dệt bền, với vẻ ngoài cổ điển của Chucks\n- Đệm CX foam giúp mang lại sự thoải mái ở cấp độ mới\n- Các chi tiết da và khâu trang trí thêm phần tinh tế\n- Các gờ cao su biến dạng giúp dễ dàng tháo giày và tăng thêm phong cách\n- Biểu tượng mắt cá chân Chuck Taylor và thương hiệu ngôi sao 3D ở gót chân', '4', '9', 0),
(59, 'Run Star Hike Canvas Platform', 2200000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204869/shopbangiayuit/%C4%91en%20m%C3%A1%20main.png.png', 'Mẫu giày yêu thích của streetwear, Run Star Hike, mang đến vẻ ngoài thấp. Vải canvas buộc dây giữ cho nó cổ điển từ phía trước, trong khi ngôi sao màu nổi bật ở gót chân định hình phong cách hiện đại. Sự phối màu thu hút sự chú ý đến đế răng cưa nổi bật.\n\nChi tiết:\n- Giày vải canvas đế cao thấp\n- Hình dáng biểu tượng được tái hiện cho streetwear hiện đại\n- Đường khâu lưỡi gà có cánh để tăng cường độ bền\n- Đế ngoài có răng cưa phối màu để tạo phong cách và độ bám\n- Đệm OrthoLite mang lại sự thoải mái\n', '4', '10', 0),
(60, 'New Balance 550', 2100000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734204967/shopbangiayuit/1.%20NB%20550%20-%20White%20Blue%203%20main.jpg.jpg', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da tổng hợp\n- Giới thiệu:\n	Phiên bản gốc NB 550 được ra mắt vào năm 1989 và đã ghi một dấu ấn sâu sắc trên toàn thế giới khi được các vận động viên chuyên nghiệp tin tưởng sử dụng. Phiên bản Retro 2021 của NB 550 được thiết thế theo phong cách của cuối thập niên 80, sử dụng các chi tiết cổ điện gợi nhớ về thời đại đơn giản, gọn gàng.\n	New Balance 550  mang lại sự thoải mái, êm chân dù sử dụng liên tục trong một thời gian dài nhờ phần đế được làm từ cao su. Phía mặt bên của phần da giày có các lỗ thoáng khí để tạo sự thoải mái khi đi lại và phần toebox được phủ da lộn giúp tăng độ bền của giày.\n	Kiểu dáng low - top, mang phong cách cổ điển phù hợp với mọi loại trang phục khác nhau. Bạn có thể kết hợp giày với quần jeans, áo phông để mang đến sự trẻ trung, năng động. Tuy đơn giản những vẫn sẽ thu hút ánh nhìn của mọi người.\n\n', '6', '9', 0),
(61, '2. New Balance Fresh Foam X 880V13', 3600000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205029/shopbangiayuit/2.%20NB%20Fresh%20Foam%20X%20880V13%20-%20Marine%20Blue%203%20main.jpg.jpg', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Vải dệt\n- Giới thiệu:\nÁP dụng công nghệ Fresh Foam X midsole với khoảng 3% chất liệu là tái chế từ nguồn tài nguyên tái tạo.\nPhom ôm chân dễ dàng di chuyển\nBọt đế giữa Fresh Foam êm ái mang đến cảm giác thoải mái\nCông nghệ đế ngoài bằng cao su NDurance mang lại độ bền vượt trội\nĐược Hiệp Hội Y Học Podiatric American (APMA) công nhận\n', '6', '10', 0),
(62, 'New Balance 530', 3200000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205097/shopbangiayuit/3.%20New%20Balance%20530%20-%20Gold%203%20main.jpg.jpg', '- Chất liệu:\n+ Phần đế: đế giữa xốp EVA\n+ Phần thân: Da và vải lưới\n- Giới thiệu:\nPhiên bản Retro 2020 NB 530 lấy cảm hứng từ phiên bản gốc NB 530 được ra mắt vào những năm 90/2000, là một đôi giày chạy bộ mang vẻ ngoài độc đáo thời thượng và là một biểu tượng thời trang ngày ấy. \nNB 530 có thiết kế kết hợp giữa chất liệu da lộn, da trơn và vải lưới tạo nên những đường nét, vân hình độc đáo tạo điểm nhấn đặc biệt. Cùng với đó là thiết kế có sự lồi lõm linh hoạt tạo độ nén khí hỗ trợ cho từng bước đi.\nNB 530 được trang bị công nghệ ENCAP, một công nghệ trung lưu cứng cáp và êm ái. Với bề mặt giày thiết kế nhiều lỗ khoáng khí cùng với cấu tạo vật liệu EVA giúp tăng độ bền và ứng dụng nâng đỗ bàn chân khi vận động một cách hiệu quả, mang đến cho người sử dụng cảm giác dễ chịu, thoải mái trong từng bước chạy.\n\n\n', '6', '9', 0),
(63, 'New Balance CT302', 1300000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205164/shopbangiayuit/4.%20New%20Balance%20CT302%20-%20Black%203%20main.jpg.jpg', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da lộn\n- Giới thiệu:\nĐược ra mắt vào năm 20022, NB CT302 mang cho mình phong cách thiết kế cổ điển vượt thời gian. NB CT302 có thiết kế đế ngoài cổ điểnn có biểu tượng N đặc trưng của New Balance cùng một miếng bọc ngón chân cao su kéo dài từ đế ngoài giúp bảo vệ chân tốt hơn. Đế giữa NB CT302 có thiết kế xếp chồng lên nhau độc đáo. Thân của giày được tạo bởi các lớp da lộn được sắp xếp hợp lý, gọn gàng. Tất cả tạo nên một đôi giày thanh lịch giản dị mà tinh tế', '6', '9', 0),
(64, 'New Balance 9060', 2900000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205229/shopbangiayuit/5.%20New%20Balance%209060%20-%20White%20Navy%203%20main.jpg.jpg', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da tổng hợp\n- Giới thiệu:\n	Phần upper bằng lưới kết hợp với da dày giúp tạo sự thoải mái, độ bền và phong cách đa dạng.\nĐế giữa dual-density tích hợp ABZORB và SBS cushioning: Mang đến sự êm ái và hỗ trợ hiệu quả cho bàn chân trong mỗi bước chạy.\nLogo trên lưỡi giày lấy cảm hứng từ ngọc trai dây buộc gốc 991: Tạo điểm nhấn thời trang và phong cách độc đáo.\nPhần đế sau trong suốt CR device: Mang đến vẻ hiện đại và sự nổi bật.\nMẫu đế ngoại cỡ hình kim cương lấy cảm hứng từ thiết kế cổ điển 860: Tạo sự độc đáo và hiệu năng cho bước chạy.', '6', '9', 0),
(65, 'New Balance Fresh Foam X More v4', 4000000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205291/shopbangiayuit/6.%20New%20Balance%20Fresh%20Foam%20X%20More%20v4%20-%20Navy%203%20main.jpg.jpg', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Vải dệt\n- Giới thiệu:\nKhám phá sự mới lạ với Giày Chạy Bộ Nam New Balance Fresh Foam X More V4 - đôi giày sử dụng lượng Fresh Foam lớn nhất từ trước đến nay. Phiên bản mới nhất trong dòng sản phẩm này sử dụng Fresh Foam X nhiều hơn, xếp nó cao hơn bao giờ hết và phân phối nó từ mũi giày đến gót giày, mang lại trải nghiệm thoải mái mềm mại và ổn định. Đế giày được thiết kế dựa trên dữ liệu, áp dụng việc đặt vùng đệm và vùng uốn cong mạnh mẽ để thúc đẩy bước chạy tự nhiên, trong khi hình dáng cong của đế giày giúp bạn trải qua sự chuyển tiếp mượt mà và điệu nghệ. Tất cả điều này nằm dưới lớp upper được thiết kế kỹ lưỡng, giữ cho bạn luôn thoải mái và được hỗ trợ với sự thoáng khí.\nFresh Foam X midsole foam với khoảng 3% chất liệu tái chế từ nguồn tài nguyên tái tạo, mang lại trải nghiệm Fresh Foam mềm mại nhất.\nUpper được thiết kế kỹ lưỡng với hỗ trợ zonal và tính thoáng khí.\nĐế giày được thiết kế dựa trên dữ liệu nghiên cứu của New Balance\nLogo 3D N được in rõ nét\nĐộ dày đế giày ở gót: 34 mm\nĐược Hiệp Hội Y Học Podiatric American (APMA) công nhận.\n', '6', '9', 0),
(66, 'New Balance FuelCell SuperComp Elite v3', 4600000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205350/shopbangiayuit/FuelCell%20SuperComp%20Elite%20v3%20-%20White%20with%20Green%203%20main.jpg.jpg', '- Chất liệu:\n+ Phần đế: xốp EVA\n+ Phần thân: Vải lưới\n- Giới thiệu:\nGiày New Balance FuelCell Supercomp Elite v3 được thiết kế với trọng lượng nhẹ cùng hệ thống Energy Arc thông minh có khả năng hoàn trả năng lượng khi hoạt động. Bên cạnh đó, phần trên bằng vải dệt kỹ thuật, thoáng khí có dây giày buộc sẵn mang lại sự tiện lợi và giúp cố định bàn chân của bạn một cách tốt hơn. Đây không chỉ là một đôi giày chạy bộ thông thường, nó sẽ giúp bạn về đích trong những trận thi đấu quan trọng.\nĐệm FuelCell mang lại cảm giác đẩy để giúp bạn tiến về phía trước\nHệ thống Energy Arc kết hợp tấm sợi carbon tiên tiến với các khoảng trống ở giữa đế được định hình và bố trí một cách chiến lược giúp bổ sung năng lượng dự trữ và hoàn trả khi bạn hoạt động. \nThiết kế phần trên bằng lưới thoáng khi với dây giày buộc sẵn\n', '6', '10', 0),
(67, 'New Balance 574', 2300000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205429/shopbangiayuit/574%20-%20Bone%20White%203%20main.jpg.jpg', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: vải lưới, da \n- Giới thiệu:\n	NB 574 được thiết thế theo phong cách của cuối thập niên 80, sử dụng các chi tiết đường né quen thuộc nhưng đầy hiện đại. NB 574 chắc chắn sẽ đáp ứng tất cả những yêu cầu của bạn. Với sự kết hợp hoàn hảo giữa chất liệu vải lưới thoáng khí, da lừa cao cấp và các chi tiết tổng hợp, đôi giày này là sự lựa chọn tối ưu cho cả nam và nữ.\nThông số:\n	Công nghệ ENCAP giúp cung cấp đệm êm ái tối ưu\n	Hệ thống dây giày truyền thống.\n	Da lõi chất lượng cao\n	Đế cao su đảm bảo độ bám vững chắc\n	Hai màu sắc của biểu tượng dòng sản phẩm N-ki\n\n', '6', '9', 0),
(68, 'New Balance Fresh Foam X 1080V12', 2800000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205493/shopbangiayuit/Fresh%20Foam%20X%201080V12%20-%20Orange%203%20main.jpg.jpg', '- Chất liệu:\n+ Phần đế: xốp EVA\n+ Phần thân: Vải lưới, vải dệt\n- Giới thiệu:\nCho dù bạn đang tập luyện cho các cuộc thi hàng đầu thế giới, hay bắt tàu vào giờ cao điểm, các tính năng công nghệ trong giày 1080 cho phép bạn làm nhiều hơn: chạy nhiều dặm hơn, thường xuyên hơn, thoải mái hơn. Phiên bản 1080v12 điều chỉnh sự kết hợp đệm, trọng lượng và tỷ lệ linh hoạt, tạo nên những trải nghiệm tối ưu trong mỗi bước chạy. Chất liệu lấy từ nguồn tài nguyên sinh học giúp giảm lượng khí thải carbon. Phần trên dạng bootie ôm sát chân giúp tạo sự vừa vặn chặt chẽ. Công nghệ đệm Fresh Foam X đặc trưng kết hợp với lớp upper được làm từ vải knitted kỹ thuật, tập trung vào tính thông thoáng và độ co giãn, cùng với những yếu tố hỗ trợ chiến lược.\nCông nghệ đệm Fresh Foam X mang lại trải nghiệm đệm Fresh Foam tốt nhất cho sự thoải mái tuyệt vời. Chất liệu lấy từ nguồn tài nguyên sinh học giúp giảm lượng khí thải carbon.\n', '6', '10', 0),
(69, 'Air Jordan 1 Low SE Craft', 2920000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205567/shopbangiayuit/Air%20Jordan%201%20Low%20SE%20Craft%201%20main.jpg.jpg', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da tổng hợp\n- Giới thiệu:\nĐôi giày luôn đi cùng với một làn sóng mới của thái độ cuốn hút và thu hút mắt. Air Jordan 1 Low SE mang lại hình dáng và chi tiết vượt thời gian mà bạn yêu thích, trong những màu sắc phản ánh phong cách cá nhân của bạn\n\n', '1', '9', 0),
(70, 'Air Jordan 1 Mid', 3950000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205635/shopbangiayuit/Air%20Jordan%201%20Mid%202%20main.jpg.webp', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da tổng hợp\n- Giới thiệu:\nAir Jordan 1 Mid mang đến phong cách sân cỏ đầy đủ và sự thoải mái cao cấp cho một diện mạo biểu tượng. Đơn vị Air-Sole của nó giảm chấn khi chơi trên sàn cứng, trong khi cổ giày đệm mang lại cảm giác hỗ trợ cho bạn.\n', '1', '9', 0),
(71, 'Air Jordan 1 Mid SE', 3950000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205686/shopbangiayuit/Air%20Jordan%201%20Mid%20SE%201%20main.jpg.jpg', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da tổng hợp\n- Giới thiệu:\nMàu sắc mới và chất liệu tươi mới mang đến cho bạn một phiên bản Air Jordan 1 cập nhật mà không làm mất đi vẻ đẹp vượt thời gian và cảm giác quen thuộc. Đôi giày yêu thích mọi thời đại này được làm từ các chất liệu cao cấp và điểm xuyết với những chi tiết tinh tế (hãy chú ý đến dấu Swoosh họa tiết voi và logo vàng) để tạo ra một đôi sneaker cơ bản nhưng vẫn mang đậm phong cách hiện đại.\n\n', '1', '9', 0),
(72, 'Jordan Retro 6 G NRG', 6400000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205750/shopbangiayuit/Jordan%20Retro%206%20G%20NRG%201%20main.jpg.webp', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da tổng hợp\n- Giới thiệu:\nĐối với những người đam mê golf muốn tìm kiếm cảm giác chiến thắng ngay từ khi bước chân lên sân, Giày Jordan Retro 6 G NRG chính là lựa chọn không thể bỏ qua. Được thiết kế dựa trên cảm hứng từ đôi giày bóng rổ huyền thoại mà Michael Jordan đã sử dụng để giành lấy chức vô địch NBA đầu tiên của mình vào năm 1991, sự kết hợp tuyệt vời giữa phong cách, hiệu suất và sự thoải mái đã được tái tạo trong đôi giày gôn này theo cách chỉ Michael Jordan mới có thể mang lại.\nVới vẻ ngoài tinh tế, sang trọng, giày được trang bị bộ phận Air có thể nhìn thấy được ở phần gót và phần trước của bàn chân để tăng cường đệm, kết hợp với đế nhựa mờ giúp tăng độ bền và độ bám, cũng như miếng đệm đúc tại gót hỗ trợ bảo vệ gân kheo. Đặc biệt, giày có hai lỗ trên lưỡi giày như một lời tri ân đến Air Jordan 5 - mẫu giày đầu tiên sở hữu tính năng này.\nKhông chỉ dừng lại ở thiết kế bên ngoài, Giày Jordan Retro 6 G NRG còn được tích hợp những công nghệ hàng đầu dành cho môn gôn từ Nike, bao gồm đế ngoài chuyên biệt cho gôn giúp tăng cường khả năng di chuyển và lực đánh, cùng với phần thân giày chống nước giữ cho đôi chân luôn khô ráo dưới mọi điều kiện thời tiết. Đế giữa bằng xốp nhẹ đảm bảo sự ổn định và thoải mái xuyên suốt mỗi vòng đấu.\nGiày Jordan Retro 6 G NRG không chỉ là một đôi giày gôn thông thường. Chúng là biểu tượng của sự tự tin và xuất sắc, phản ánh phong cách và đam mê của bạn trên sân. \n\n\n', '1', '9', 0),
(73, 'Jumpman MVP', 4800000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205817/shopbangiayuit/Jumpman%20MVP%202%20main.jpg.webp', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da tổng hợp, vải mesh\n- Giới thiệu:\nNếu bạn là fan của những phiên bản Air Jordan cổ điển, tin tức về một dòng giày hybrid mới từ Nike sẽ khiến bạn hào hứng. Được gọi là Nike Jumpman MVP, đôi giày này là sự kết hợp hoàn hảo của AJ6, 7, và 8, nhằm vinh danh ba chức vô địch NBA liên tiếp của Michael Jordan từ 1991 đến 1993, một thành tựu hiếm hoi trong lịch sử bóng rổ. \nGiày Nike Jumpman MVP mang đến một thiết kế độc đáo, hòa trộn giữa da, vải dệt và nubuck, cùng với việc kết hợp những đặc điểm nổi bật từ các mẫu giày gốc. Lưỡi gà và phần phủ bên ngoài được lấy cảm hứng từ AJ6, đôi giày Jordan mang khi giành chức vô địch đầu tiên chống lại Lakers vào năm 1991. Phần lót kiểu bootie đến từ AJ7, chiếc giày giúp Jordan chinh phục Blazers vào năm 1992 và giành MVP lần thứ hai. Các chi tiết như logo Nike Air thêu và chi tiết đúc ở phần gót chân được lấy cảm hứng từ AJ8, đôi giày Jordan dùng để vượt qua Suns vào năm 1993, hoàn tất cú hat-trick chức vô địch của mình. Thiết kế đế ngoài, lấy cảm hứng từ AJ6, bao gồm cao su trong suốt và khối Air-Sole có thể nhìn thấy, mang lại độ bám và đệm lý tưởng. \nĐôi Giày Nike Jumpman MVP không chỉ đơn thuần là một phiên bản remix, mà còn là một lời tôn vinh văn hóa Jordan và là cơ hội để bạn khẳng định phong cách cá nhân. Đừng bỏ lỡ cơ hội sở hữu một trong những đôi giày thể thao đặc biệt này.\n\n', '1', '9', 0),
(74, 'Nike Air Force 1\'07', 2920000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205892/shopbangiayuit/Nike%20Air%20Force%201_07%201%20main.jpg.webp', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da tổng hợp\n- Giới thiệu:\nĐược ra mắt lần đầu tiên vào năm 1982. Ban đầu Air Force 1 là thứ không thể thiếu trong bóng rổ, sau đó nó đã dần hình thành phong cách riêng của mình vào những năm 90. Vẻ ngoài gọn gàng của Air Force 1 với màu trắng cổ điển đã được khẳng định và ưa chuộng từ sân bóng rổ đến đường phố. Bắt nhịp được với văn hóa hip-hop, Air Force 1 không chỉ là đôi giày thể thao, mà còn là biểu tượng của sự hợp tác và sáng tạo, trở thành đôi giày thể thao mang tính biểu tượng trên toàn cầu.\nVới lớp phủ da được may chắc chắn, đôi giày có độ bền cao và mang phong cách cổ điển. Ban đầu được thiết kế phục vụ cho việc chơi bóng rổ nhưng với việc tích hợp đệm Nike Air mang lại sự hỗ trợ nhẹ nhàng và thoải mái suốt cả ngày. Việc sử dụng cổ lót đệm và các lỗ thông hơi ở đầu giày, Air Force 1 đặt sự thoải mái và độ thông thoáng lên hàng đầu. Đế giày làm bằng cao su giúp tăng độ bám và độ bền. Thiết kế low-cut mang lại vẻ ngoài gọn gàng, phù hợp cho mọi dịp.\nVới hơn 2000 phiên bản, ảnh hưởng của Air Force 1 đối với thời trang, âm nhạc và văn hóa giày dép vẫn không thể phủ nhận, sản phẩm nhiều người dùng tin tưởng.', '1', '9', 0),
(75, 'Nike Air Max SYSTM', 2770000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734205946/shopbangiayuit/Nike%20Air%20Max%20SYSTM%201%20main.jpg.webp', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da tổng hợp, vải mesh\n- Giới thiệu:\nNhìn thấy Max, cảm thấy Max. Air Max SYSTM mang trở lại tất cả những gì bạn yêu thích về phong cách những năm 80 (không có quần dù đâu nhé). Đệm Nike Air quen thuộc và đáng tin cậy kết hợp với phần thân giày tinh tế, lấy cảm hứng thể thao. Đó là Air Max, một lần nữa.\n', '1', '9', 0),
(76, 'Nike Blazer Mid\'77 Vintage', 2900000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734206011/shopbangiayuit/Nike%20Blazer%20Mid%20_77%20Vintage%201%20main.jpg.webp', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da tổng hợp\n- Giới thiệu:\nLấy cảm hứng từ phong cách thập niên ’70 và được yêu thích từ những năm 80 nhưng lại mang đậm chất cổ điện vào những năm 90. Blazer Mid ’77 mang đến thiết kế vượt thời gian mà dễ dàng kết hợp với mọi trang phục. \nPhần thân giày bằng da sáng bóng mềm mại sắc nét mang phong cách cá tính theo thời gian kết hợp với nhãn hiệu và da lộn tạo cảm giác sang trọng. Lớp xốp trên lưỡi giày và lớp trên đế giữa mang lại cảm giác hoài niệm. Ngoài ra, đôi giày còn có cấu trúc autoclave để ngoài với đế giữa, tạo diện mạo hợp lý và sang trọng không bao giờ lỗi mốt.\nNike Blazer Mid ’77 là giày cũ hàng hiệu, biểu tượng của sự kết hợp hoàn hảo giữa phong cách cổ điển và hiện đại. Với thiết kế vượt thời gian, đôi giày này là một lựa chọn hoàn hảo cho phong cách tự tin và cá tính của người mang.\n', '1', '9', 0),
(77, 'Nike Dunk Low Retro', 2900000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734206059/shopbangiayuit/Nike%20Dunk%20Low%20Retro%201%20main.jpg.webp', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da tổng hợp\n- Giới thiệu:\nNike Dunk Low Retro là phiên bản tái phát hành của mẫu giày Nike Dunk Low huyền thoại, được sản xuất lại với các chi tiết thiết kế và màu sắc cổ điển, đồng thời cải tiến một số yếu tố để mang lại sự thoải mái và phù hợp với xu hướng hiện đại. Nike Dunk Low lần đầu tiên ra mắt vào năm 1985 và nhanh chóng trở thành một trong những mẫu giày phổ biến nhất trong văn hóa thể thao và streetwear. Phiên bản Retro là một sự hồi sinh của mẫu giày này, giữ nguyên vẻ đẹp cổ điển nhưng với các cập nhật tinh tế.', '1', '9', 0),
(78, 'Nike Honor The Gift x Jordan Why Not Zer0.6 PF', 4690000, 'https://res.cloudinary.com/dxtslecpc/image/upload/v1734206124/shopbangiayuit/Jordan%20Why%20Not%20.6%20x%20Honor%20The%20Gift%C2%AE%20PF%201%20main.jpg.webp', '- Chất liệu:\n+ Phần đế: Cao su\n+ Phần thân: Da tổng hợp, vải mesh\n- Giới thiệu:\nGiày Nike Honor The Gift x Jordan Why Not Zer0.6 PF là một phiên bản hợp tác đặc biệt giữa Nike, Honor The Gift (thương hiệu của Russell Westbrook) và Jordan Brand, mang đến một thiết kế mạnh mẽ, độc đáo và phù hợp cho các vận động viên cũng như những người yêu thích thời trang. Đây là mẫu giày trong dòng Jordan Why Not Zer0 của Westbrook, nổi bật với hiệu suất thi đấu cao và sự sáng tạo trong thiết kế.', '1', '9', 0);
